import Link from 'react-router-dom' //when link is used it renders pages without reloading whereas in a tag reloading is done

const Menu=()=> (
    <div>
    <Link to ="/">Home</Link>
    <Link to ="/signin">Sign in</Link>
    <Link to ="/signup">Sign up</Link>
</div>
)
export default Menu;
